DescrLonga=A Coenzima Q10 é produzida naturalmente no organismo, participando do metabolismo antioxidante e energético, porém essa produção tende a diminuir com o passar dos anos, causando uma deficiência nutricional. A CoQ10 Vitafor possui 100mg de CoQ10 por cápsula.

Beneficios e Diferenciais
· Enriquecida com vitamina E;· Com corante natural (carotenóide); 
· Melhora distúrbios cardiovasculares;
· Protege as mitocôndrias;
· Previne doenças degenerativas;
· Fortalece sistema imunológico;
· Protege contra stress oxidativo  ação antioxidante;
· Indicado em casos de fadiga crônica;
· Auxilia efeitos colaterais das estatinas. Pacientes que fazem uso crônico de estatinas tem depleção de CoQ10 (inibidores HGMcoa 2,4 ,5 redutase);
· Equilíbrio metabólico e energético celular;
· Pode contribuir na melhora da performance esportiva, devido à produção de energia e vasodilatação, que melhora o transporte de oxigênio e nutrientes para o corpo, inclusive para o músculo;
